import React from 'react';
import { useNavigate } from 'react-router-dom';
import headbg from './Images/header_bg.jpg';
import wesafelogo from './Images/wesafe_Logo.png';
import userprofile from './Images/avatar.png';
import toggle from './Images/toggle_menu.png';

const Dashboard = ({ userProfile, onToggleSidebar }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Add your logout logic here (clear tokens, update state, etc.)
    navigate('/');
  };

  return (
    <div className="relative bg-cover bg-no-repeat bg-center h-24 flex items-center px-4" style={{ backgroundImage: `url(${headbg})` }}>
      <button onClick={onToggleSidebar} className="focus:outline-none">
        <img src={toggle} alt="Toggle Menu" className="h-8 w-8" />
      </button>

      <div className="flex-grow">
        <img src={wesafelogo} alt="Company Logo" className="mx-auto h-16" />
      </div>

      <div className="absolute right-4 flex items-center">
        <img src={userprofile} alt="User Profile" className="h-12 w-12 rounded-full border-2 border-white" />
        {/* Include status indicator here if applicable */}
        <button onClick={handleLogout} className="ml-4 bg-white rounded-full px-4 py-1 shadow-lg font-medium text-green-600">
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
